import './App.css';
import React from 'react';
import { Route, Routes } from 'react-router-dom'; // No need to import Router
function App() {
  const navigate = useNavigate();

  const goToPage = (path) => {
    navigate(path); // This will navigate to the given path
  };

  return (
<div className="flex flex-col min-h-screen">
      {/* Header */}
      <Header />

      {/* Main Content */}
      <main className="flex-grow">
        <Routes>
          <Route path="/" element={<Main />} />
          <Route path="/team-structure" element={<TeamStructure />} />
          <Route path="/meetings" element={<MeetingRecords />} />
          <Route path="/documents" element={<Documents />} />
        </Routes>
      </main>

      {/* Footer */}
      <Footer />
    </div>
  );
}

export default App;
